import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class LandingPage extends Component {
    render() {
        return (
            <div className="landing-container" style={{ height: '100%', width: '100%', margin: 'auto 0' }}>
                <Grid className="landing-grid">
                    <Cell col={12}>
                        {/* <img src="https://www.zivarentals.com/wp-content/uploads/2017/09/avatar-1606916_960_720-1.png" alt="avatar" className="avatar-img"></img> */}
                        <img src="data:image/png;base64," alt="avatar" className="avatar-img"></img>
                        <h1 style={{ color: "white", margin: 0 }}>Jason Huang</h1>
                        <div className="banner-text">
                            <h1>Software Engineer</h1>
                            <hr />
                            <p style={{ width: "60%", margin: "0 auto", lineHeight: "27px" }}>Java | Python | JavaScript&NodeJS | C# | React | Spring | Django | Flask | Express | Angular | ASP.NET Core (MEAN) | Redis | MongoDB | SQLite | Cassandra | NPM | NuGet | Webpack | Gulp | Redux | HTML/CSS | Bootstrap | JQuery</p>
                            <div className="social-links">
                                {/* LinkedIn */}
                                <a href="https://www.linkedin.com/in/jason-huang-a3214119a" target="_blank" rel="noopener noreferrer">
                                    <i className="fa fa-linkedin-square" aria-hidden="true" />
                                </a>
                                {/* GitHub */}
                                <a href="https://github.com/hjszion" target="_blank" rel="noopener noreferrer">
                                    <i className="fa fa-github-square" aria-hidden="true" />
                                </a>
                                {/* LeetCode */}
                                <a href="https://leetcode.com/hjscoder/" target="_blank" rel="noopener noreferrer">
                                    <i className="fa fa-code" aria-hidden="true" />
                                </a>
                                {/* YouTube */}
                                <a href="/#" rel="noopener noreferrer">
                                    <i className="fa fa-youtube-square" aria-hidden="true" />
                                </a>
                            </div>
                        </div>

                    </Cell>
                </Grid>
            </div>
        )
    }
}

export default LandingPage;
